                            temp_min={main.temp_min}
                            dt={dt * 1000}
                            main={weather[0].main}
                            icon={weather[0].icon}
                        />
                     </Col>
                }
            else {
                return null;
              }
         }, {}
            )}
        </Row>

    )
}

export default WeatherList
